-- ----------------------------
-- Procedure structure for activeCustomer
-- ----------------------------
DROP PROCEDURE IF EXISTS `activeCustomer`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `activeCustomer`(
	IN storeId VARCHAR(20),
	IN startDate DATETIME,
  IN endDate DATETIME,
	OUT once INT,
	OUT twice INT,
	OUT repeatedly INT
)
BEGIN
	#Routine body goes here...
	
	CREATE TEMPORARY TABLE IF NOT EXISTS temp_customer_views(visitor_id VARCHAR(20),views INT);
	TRUNCATE TABLE temp_customer_views;

		SET @tableName = CONCAT("sys_store_log_",storeId);
		
		SET @sqlStrTemp = CONCAT("INSERT INTO temp_customer_views(visitor_id,views) SELECT visitor_id,count(*) as views FROM ", @tableName," WHERE create_date BETWEEN '",startDate,"' AND '",endDate,"' GROUP BY visitor_id");

    PREPARE stmtTemp from @sqlStrTemp;
    EXECUTE stmtTemp;
    DEALLOCATE PREPARE stmtTemp;  
		
		
		SELECT count(*) into once FROM temp_customer_views WHERE views > 1 && views < 2;
		SELECT count(*) into twice FROM temp_customer_views WHERE views >=2 && views < 3;
		SELECT count(*) into repeatedly FROM temp_customer_views WHERE views >= 3;

-- 			SELECT SUM(CASE WHEN views > 1 && views < 2 THEN 1 ELSE 0 END) as once, SUM(CASE WHEN views >=2 && views < 3 THEN 1 ELSE 0 END) as twice, 
-- 		SUM(CASE WHEN views >= 3 THEN 1 ELSE 0 END) as repeatedly FROM temp_customer_views;
		




END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for createAliance
-- ----------------------------
DROP PROCEDURE IF EXISTS `createAliance`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `createAliance`(IN `userId` bigint(20),OUT `flag` varchar(10),OUT `msg` varchar(20))
BEGIN
	#Routine body goes here...
	DECLARE num_total INT(11);
	DECLARE views INT(11);
	DECLARE collections INT(11);
	DECLARE salers INT(11);

/****************************
**业务规则描述：
   门店创建联盟规则：
   首先门店自身状态无异常
	 
   1.  门店浏览量 > 1000
   2.  门店收藏数 > 100
   3.  门店拥有销售人数 > 10 
	 
****************************/

	calculate:begin
	
	set num_total =  (SELECT count(1) as num FROM store_body sb INNER JOIN sys_minapp_user smu ON sb.create_user_id = smu.user_id AND sb.create_user_id = userId);
	
	IF num_total < 1 THEN
	set flag = 0;
	set msg = '门店信息异常，无法创建联盟！'; 
	leave calculate;
	
ELSE 

	set views = (SELECT view FROM store_body sb WHERE sb.create_user_id = userId); 
	set collections = (SELECT collection FROM store_body sb WHERE sb.create_user_id = userId); 
	set salers = (SELECT count(1) FROM sale_info si INNER JOIN store_body sb ON sb.store_id = si.store_id AND sb.create_user_id = userId);
	
	IF views < 100 THEN
		set flag = 0;
		set msg = '门店浏览数不符合，无法创建联盟！'; 
		leave calculate;
	ELSEIF collections < 10 THEN
		set flag = 0;
		set msg = '门店收藏数不符合，无法创建联盟！'; 
		leave calculate;
	ELSEIF salers < 0 THEN
		set flag = 0;
		set msg = '门店销售人数不符合，无法创建联盟！'; 
		leave calculate;
	ELSE 
		set flag = 1;
		set msg = '创建联盟'; 
		leave calculate;

	END IF;

END IF;
	
END calculate;  

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for customerSta2
-- ----------------------------
DROP PROCEDURE IF EXISTS `customerSta2`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `customerSta2`()
BEGIN
	#Routine body goes here...
	DECLARE storeId int;
	DECLARE userId int;
	DECLARE view_num int(11);
	
	DECLARE comment_num int(11);
DECLARE done int DEFAULT FALSE;
