-- ----------------------------
-- Procedure structure for percentSta
-- ----------------------------
DROP PROCEDURE IF EXISTS `percentSta`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `percentSta`()
    COMMENT '商品热卖（被浏览、预约、订单）百分比统计'
BEGIN
 
	DECLARE id int(50);
  DECLARE total_view int;
  DECLARE total_reserve int;
  DECLARE total_order int ;
  DECLARE view_per double;
  DECLARE reserve_per double;
  DECLARE order_per double;
  

  SELECT sum(view_sum) INTO total_view FROM sta_product_whole;       -- 该门店所有商品浏览总数
  SELECT sum(reserve_sum) INTO total_reserve FROM sta_product_whole; -- 该门店所有商品预约总数
  SELECT sum(order_sum) INTO total_order FROM sta_product_whole;     -- 该门店所有商品成交订单总数

  BEGIN 
      DECLARE product_id int;
      declare view_sum int;
      DECLARE reserve_sum int ;
      DECLARE order_sum int;
    	DECLARE done int DEFAULT FALSE;
    	DECLARE pro CURSOR FOR select SPW.product_id,SPW.view_sum,SPW.reserve_sum,SPW.order_sum FROM sta_product_whole SPW;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;      -- 声明：当继续处理程序找不到可处理的数据了，把done设置为true
    	OPEN pro;                                                    -- 打开游标
      	pro_loop:LOOP                                              -- 开始循环
        	FETCH pro INTO product_id,view_sum,reserve_sum,order_sum;        -- 提取游标里的数据
        			IF done THEN                                         -- 判断退出循环时机
        				LEAVE pro_loop;
        			END IF;
              -- 开始事务处理
              -- 统计当面门店的浏览人数、预约人数、下单人数占总商品的百分比
          IF total_view !=0 then
             set view_per =ROUND(view_sum/total_view*100,2) ;           -- 商品浏览人数百分比
          end if;
          IF total_reserve !=0 then
             set reserve_per = ROUND(reserve_sum/total_reserve*100,2);  -- 商品预定人数百分比
          END IF;
          IF total_order !=0 then
             set order_per = ROUND(order_sum/total_order*100,2);        -- 订单人数百分比
          END IF;
              -- 把统计结果写入对应字段
            UPDATE sta_product_whole spw set spw.peri1 = view_per,spw.peri2 = reserve_per,spw.peri3 = order_per WHERE spw.product_id=product_id;
    		end LOOP;
    	CLOSE pro;
    END;
END
;;
delimiter ;

