-- ----------------------------
-- Procedure structure for staSaleDay
-- ----------------------------
DROP PROCEDURE IF EXISTS `staSaleDay`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `staSaleDay`()
BEGIN
/*
  1. 查询sale_info表获取所有销售saleId、门店storeId
  2. 根据storeId 和 saleId 查询 sys_store_log_storeId 表 获取当天的view_sum、praise_sum、comment_sum、collection_sum
  3. 根据门店Id和销售Id查询staSaleDay表，如果存在就更新，不存在就插入一条新的记录
 */

  -- 定义接收游标数据的变量
  DECLARE saleId varchar(20);
  DECLARE storeId varchar(20);
  DECLARE staDay date DEFAULT DATE_SUB(curdate(),INTERVAL 1 DAY);

    -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;
  DECLARE cur CURSOR FOR SELECT user_id,store_id from sale_info;
  -- 将结束标志绑定到游标
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  -- 打开游标
  OPEN cur;
  -- 开始循环
  read_loop: LOOP
    -- 提取游标里的数据
    FETCH cur INTO saleId,storeId;
	
    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;
    -- 这里做你想做的循环的事件
		-- 从销售表获取所有storeId、saleId,如果销售（day）统计表中不存在这一天的数据则插入，存在则不做操作
    -- REPLACE INTO sta_store_day (store_id,day) VALUES (storeId, NOW());
    
    SET @sqSumCount = CONCAT("select 
      count(case when operation_id = 1 then 1 else null end) viewCount, 
      count(case when operation_id = 2 then 1 else null end) praiseCount,
      (count(case when operation_id = 6 then 1 else null end)-count(case when operation_id = 7 then 1 else null end)) commentCount,
      (count(case when operation_id = 4 then 1 else null end)-count(case when operation_id = 5 then 1 else null end)) collectionCount 
      from sys_store_log_",storeId ," WHERE user_id =",saleId," and DATE_FORMAT(create_date,'%Y-%m-%d')='",staDay,"' INTO @sqlSaleViewCount,@sqlSalePraiseCount,@sqlSaleCommentCount,@sqlSaleCollectionCount");
    
     PREPARE sqSumCount FROM @sqSumCount;
     EXECUTE sqSumCount;
     DEALLOCATE PREPARE sqSumCount;  
   
  
    -- 订单相关数据
   
    select COUNT(CASE WHEN status =3 AND DATE_FORMAT(deal_time,'%Y-%m-%d')= staDay THEN 1 ELSE NULL end),
    COUNT(CASE WHEN status =4 AND DATE_FORMAT(deal_time,'%Y-%m-%d')= staDay THEN 1 ELSE NULL end),
    COUNT(CASE WHEN DATE_FORMAT(reserve_time,'%Y-%m-%d')= staDay AND status >=2 THEN 1 ELSE NULL END)
    from order_reserve where sale_id=saleId and store_id=storeId INTO  @SaleOrderCount,@SaleOrderUndoCount,@SaleTrackingCount;
    select count(1) from order_records where sale_id=saleId and DATE_FORMAT(follow_time,'%Y-%m-%d')= staDay AND status =1 INTO @SaleArriveCount;
    select count(distinct user_id) FROM order_reserve WHERE sale_id = saleId AND deal_time =  DATE_FORMAT('",staDay,"','%Y-%m-%d') AND  user_id not in (select user_id from order_reserve where status = 3 AND deal_time != DATE_FORMAT('",staDay,"','%Y-%m-%d') AND  store_id = storeId) INTO @SaleCustomerCount ;
		
    SET @sqlSaleSumResult =  CONCAT("UPDATE sta_sale_day SET view_sum =", @sqlSaleViewCount,
    ",praise_sum=", @sqlSalePraiseCount,
    ",comment_sum=", @sqlSaleCommentCount,
    ",collection_sum=",@sqlSaleCollectionCount,
    ",tracking_sum =",@SaleTrackingCount,
    ",reserve_sum = ",@SaleTrackingCount,
    ",order_sum = ",@SaleOrderCount,
    ",total_order_sum=",@SaleOrderCount+@SaleOrderUndoCount,
    ",customer_sum=",@SaleCustomerCount,
    ",arrive_sum =",@SaleArriveCount,        
    " WHERE user_id = ",saleId," and DATE_FORMAT(sta_day,'%Y-%m-%d')  ='",staDay,"'");
    PREPARE stmtSale from @sqlSaleSumResult;
    EXECUTE stmtSale;
    DEALLOCATE PREPARE stmtSale;  
    
  END LOOP;
  -- 关闭游标
  CLOSE cur;
END
;;
delimiter ;

