    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;
    -- 这里做你想做的循环的事件
    IF
      totalOrderSum=0 THEN set @oderDoneRate =100;
      ELSE
      SET @oderDoneRate = orderSum/totalOrderSum;
    END IF;
    VALUES (saleId,storeId,viewSum,praiseSum,commentSum,collectionSum,orderSum,customerSum,reserveSum) 
    ON DUPLICATE KEY UPDATE user_id = saleId,view_sum=viewSum,praise_sum=praiseSum,comment_sum=comment_sum,collection_sum=collectionSum,order_sum=orderSum,customer_sum=customerSum,reserve_sum=reserveSum;
  
  
  END LOOP;
  -- 关闭游标
  CLOSE cur;
END
