-- ----------------------------
-- Procedure structure for staStoreWhole
-- ----------------------------
DROP PROCEDURE IF EXISTS `staStoreWhole`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `staStoreWhole`()
BEGIN
	#Routine body goes here...

-- 	需要定义接收游标数据的变量
  DECLARE storeId VARCHAR(20);
  DECLARE viewSum VARCHAR(11);
  DECLARE praiseSum VARCHAR(11);
  DECLARE collectionSum VARCHAR(11);
  DECLARE commentSum VARCHAR(11);

  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;
  DECLARE cur CURSOR FOR SELECT store_id,view,praise,collection,comment from store_body where 1 = 1;
  -- 将结束标志绑定到游标
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  -- 打开游标
  OPEN cur;
  -- 开始循环
  read_loop: LOOP
    -- 提取游标里的数据
    FETCH cur INTO storeId,viewSum,praiseSum,collectionSum,commentSum;
	
    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;
    -- 这里做你想做的循环的事件
		-- 从门店表获取所有门店id,如果门店统计表中不存在某门店id则插入，存在则不做操作
-- 		insert ignore into sta_store_whole (store_id) values (storeId);
		
		
		-- 统计门店销售数
		SET @sqlStrViewCount = CONCAT("UPDATE sta_store_whole ssw set ssw.sale_sum = ( SELECT count(*) AS num FROM sale_info si WHERE si.store_id = ",storeId," ) WHERE ssw.store_id = ",storeId);
    PREPARE stmtView from @sqlStrViewCount;
    EXECUTE stmtView;
    DEALLOCATE PREPARE stmtView;  
		
		-- 统计门店预约单数
		SET @sqlStrReserveCount = CONCAT("UPDATE sta_store_whole ssw set ssw.reserve_sum = ( SELECT(IF(( SELECT sum(reserve_sum) AS num FROM sta_product_whole spw WHERE spw.store_id = ",storeId," ) IS NULL,0,( SELECT sum(reserve_sum) AS num FROM sta_product_whole spw WHERE spw.store_id = ",storeId," ))) t) WHERE ssw.store_id = ",storeId);
    PREPARE stmtReserve from @sqlStrReserveCount;
    EXECUTE stmtReserve;
    DEALLOCATE PREPARE stmtReserve;  

		-- 统计门店订单数
		SET @sqlStrOrderCount = CONCAT("UPDATE sta_store_whole ssw set ssw.order_sum = (SELECT(IF(( SELECT sum( order_sum ) AS num FROM sta_product_whole spw WHERE spw.store_id = ",storeId," ) IS NULL,0,( SELECT sum( order_sum ) AS num FROM sta_product_whole spw WHERE spw.store_id = ",storeId," ))) t) WHERE ssw.store_id = ",storeId);
    PREPARE stmtOrder from @sqlStrOrderCount;
    EXECUTE stmtOrder;
    DEALLOCATE PREPARE stmtOrder;  
		
		-- 统计门店客户数
		SET @sqlStrCustomerCount = CONCAT("UPDATE sta_store_whole ssw set ssw.customer_sum = (SELECT count(*) FROM( select count(*) from order_reserve where status = 3 and store_id = ",storeId," GROUP BY user_id",") t ) WHERE ssw.store_id = ",storeId);
    PREPARE stmtCustomer from @sqlStrCustomerCount;
    EXECUTE stmtCustomer;
    DEALLOCATE PREPARE stmtCustomer;  
		
		
		-- 统计顾客到店数
		SET @sqlStrArrivalCount = CONCAT("UPDATE sta_store_whole ssw set ssw.arrival_sum = ( SELECT count(*) AS num FROM order_records orc,order_reserve ors WHERE orc.order_id = ors.id and orc.status = 1 and ors.store_id = ",storeId," ) WHERE ssw.store_id = ",storeId);
    PREPARE stmtArrival from @sqlStrArrivalCount;
    EXECUTE stmtArrival;
    DEALLOCATE PREPARE stmtArrival;  

		
		
		
  END LOOP;
  -- 关闭游标
  CLOSE cur;
	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for staticticsActivity
-- ----------------------------
DROP PROCEDURE IF EXISTS `staticticsActivity`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `staticticsActivity`()
    COMMENT '需要被统计获奖的活动'
BEGIN

   DECLARE activityId int;                    -- 临时activityId记录

   BEGIN
        #遍历数据结束标志
        DECLARE done INT DEFAULT FALSE;
      
        #游标
        DECLARE cur CURSOR FOR SELECT activity_id FROM store_activity sa WHERE sa.activity_status = 1 AND sa.end_date < now(); -- 1:正在进行中的，小于当前时间的终止活动日期，都被认为应该停止活动，需要被清算
          #将结束标志绑定到游标
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
      
        -- 打开游标
        OPEN cur;
        -- 开始循环
        read_loop: LOOP
              -- 提取游标里的数据
              FETCH cur INTO activityId; 
              -- 声明结束的时候
          IF done THEN
            LEAVE read_loop;
          END IF;
              -- 事务处理
            call statisticsCaseAward(activityId);
       END LOOP;
       -- 关闭游标 
      CLOSE cur; 
  END;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for statisticsCaseAward
-- ----------------------------
DROP PROCEDURE IF EXISTS `statisticsCaseAward`;
delimiter ;;
CREATE DEFINER=`yz_dev`@`%` PROCEDURE `statisticsCaseAward`(IN activityId BIGINT)
    COMMENT '门店活动案例奖励统计'
BEGIN
    DECLARE award_first int;  -- 一等奖条件
    DECLARE award_second int; -- 二等奖条件
    DECLARE award_third int;  -- 三等奖条件

    DECLARE firstReward varchar(255);  -- 一等奖奖励
    DECLARE secondReward varchar(255); -- 二等奖奖励
    DECLARE thirdReward varchar(255);  -- 三等奖奖励
    DECLARE recordCount int;           -- 案例被点赞、评论或浏览量
    DECLARE id int;                    -- 临时id记录
 
   -- UPDATE store_activity_join saj SET saj.case_status=1 WHERE saj.id in(SELECT  saj.id FROM store_activity_join saj  WHERE  saj.activity_id = activityId);  -- 案例设为终止
    UPDATE store_activity sa SET sa.activity_status=0 WHERE sa.activity_id=activityId;   -- 门店活动表设置为终止
    
    SELECT sa.award_first,sa.award_second,sa.award_third,sa.reward_first,sa.reward_second,sa.reward_third INTO award_first,award_second,award_third,firstReward,secondReward,thirdReward FROM store_activity sa  WHERE  sa.activity_id = activityId;
    -- 获取活动的获奖条件、奖励等级
   	  BEGIN
        #遍历数据结束标志
        DECLARE done INT DEFAULT FALSE;
      
        #游标
        DECLARE cur CURSOR FOR SELECT saj.id FROM store_activity_join saj  WHERE  saj.activity_id = activityId; --  统计案例
          #将结束标志绑定到游标
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
      
        -- 打开游标
        OPEN cur;
        -- 开始循环
        read_loop: LOOP
              -- 提取游标里的数据
              FETCH cur INTO id; 
              -- 声明结束的时候
          IF done THEN
            LEAVE read_loop;
          END IF;
              -- 事务处理
              SELECT COUNT(1) INTO recordCount FROM store_activity_case_praise sacp WHERE sacp.join_id = id;
              UPDATE store_activity_join saj SET saj.case_status=1 WHERE saj.id =id;
              IF recordCount >award_first THEN 
                 UPDATE store_activity_join saj SET saj.award=firstReward WHERE saj.id=id;
              ELSEIF recordCount>award_second THEN
                 UPDATE store_activity_join saj SET saj.award=secondReward WHERE saj.id=id;
              ELSEIF recordCount>award_third THEN
                 UPDATE store_activity_join saj SET saj.award=thirdReward WHERE saj.id=id;
              END IF;
        
       END LOOP;
       -- 关闭游标 
      CLOSE cur; 

    END;
END
;;
delimiter ;

-- ----------------------------
-- Event structure for staticticsActCaseAward
-- ----------------------------
DROP EVENT IF EXISTS `staticticsActCaseAward`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `staticticsActCaseAward`
ON SCHEDULE
EVERY '1' DAY STARTS '2019-01-01 00:00:01'
COMMENT '定时终止门店活动并统计案例获奖等级'
DO BEGIN
  CALL staticticsActivity();
END
;;
delimiter ;

